import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <header className="bg-white shadow-md sticky top-0 z-50">
      <div className="container mx-auto px-4 py-4 flex justify-between items-center">
        <Link to="/" className="flex items-center space-x-2">
          <img src="/summit-logo.svg" alt="Site Summit logo" className="h-8 w-8" />
          <span className="text-2xl font-bold text-blue-600">Site Summit</span>
        </Link>
        <nav className="space-x-4 text-gray-700 font-medium">
          <Link to="/starter" className="hover:text-blue-600 transition">Starter</Link>
          <Link to="/business" className="hover:text-blue-600 transition">Business</Link>
          <Link to="/platform" className="hover:text-blue-600 transition">Platform</Link>
        </nav>
      </div>
    </header>
  );
}
